INSERT INTO `letter` VALUES (1,'ㅋㅎㅋㅎㅋㅎㅋㅎ',1,'2022-11-16 01:32:17',2,1,'green'),(2,'하이하이 밍귤',1,'2022-11-16 01:35:23',1,2,'pink'),(3,'sysysysysy',1,'2022-11-16 01:37:50',3,1,'yellow'),(4,'good evening',1,'2022-11-16 01:43:24',4,1,'yellow'),(5,'승연아 디비 미러서 미아내',1,'2022-11-16 01:44:18',5,1,'green'),(6,'ㅋㅋㅋㅋㅋ',1,'2022-11-16 01:54:44',8,1,'yellow'),(7,'bobobobobobonananananana',0,'2022-11-17 00:32:45',2,4,'green'),(8,'보나야 잘자\n',0,'2022-11-17 02:53:45',1,4,'yellow'),(9,'zxczxcascasc',1,'2022-11-17 12:40:34',4,1,'pink'),(10,'우리 딸.. 이번 주말에 콘서트 간다고...??\n\n코로나 19가 다시 심해지고 있읍니다..\n\n부디 조심하고 우리딸 아자아자!!!~',1,'2022-11-14 13:42:16',12,11,'pink'),(11,'아들~~ 엄마가 사랑하는거 알지??\n이제 게임 그만하고 열심히 공부하자~~\n내년에 고3인데 좋은 학교 가야지~~~\n항상 엄마가 응원해!!♥️',0,'2022-11-14 13:51:09',13,10,'pink'),(12,'아부지\n늘 건강하시고\n저 마싯는거 많이 사주세영~~~~???\n알랍뽕따이',0,'2022-11-14 13:51:14',11,12,'green'),(13,'나 게임하는거 보고 뭐라 안해서 고맙다\n\n공부 열심히 하고 \n\n근데 과자 좀 말하고 먹어라 ㅋ\n\n화이팅!',1,'2022-11-14 13:52:11',10,11,'pink'),(14,'아브지\n용돈좀더주세요ㅠ\n대학생이한달에십마넌이시롸??\n옆집지영이는오십만원받던데ㅜ',0,'2022-11-15 14:03:25',11,12,'pink'),(15,'딸~~\n\n공부 열심히 하는 모습 보고 아빠도 열심히 살려고\n\n아는분한테 귤을 받았는데 귤 먹고 힘내렴\n\n우리딸 사랑해',1,'2022-11-15 14:03:57',12,11,'green'),(16,'무뚝뚝하지만 항상 가족을 생각하는거 잘 알아요~~\n\n언제나 돈 벌어오느라 힘들텐데 힘든 내색 없이 잘 지내줘서 고마워요\n\n근데 이번에 샤넬 신상 나왔던데... 그냥 그렇다구요',1,'2022-11-15 14:05:00',13,12,'green'),(17,'누나 제발 씻어\n\n진짜 이런말 얼굴보고 하기 힘들어서..\n\n제발.. 씻고 나와줬으면 해..\n\n화내지 말고.. 고마워',1,'2022-11-15 14:05:53',10,11,'yellow'),(18,'엄마는 왜 아빠랑 결혼한거야??\n미스테리\n마이 마쟈 화이탱~❤?',1,'2022-11-16 14:07:18',11,13,'yellow'),(19,'아들아 철좀 들어라\n맨날 방에서 잠 게임 잠 게임\n언제 공부하고 언제 대학가고 할래?\n너 때문에 속이 터진다 터져 어휴',1,'2022-11-16 14:07:45',13,10,'yellow'),(20,'최근에 동생이랑 씻는거때문에 싸웠다며??\n\n누구의 말이 맞는진 모르겠지만\n\n내 후각은 꽤나 정확해..\n\n용기 낸 동생에게 고맙고\n\n화이팅~~~',1,'2022-11-16 14:07:52',12,11,'yellow'),(21,'엄마!\n\n라면끓여줘!\n\n너구리 고추 계란\n\n마시쪙!!\n\n늘 제 이상한 말 들어줘서 고마워용~',1,'2022-11-16 14:08:58',10,13,'green'),(22,'엄마!! \n\n요즘 많이 힘드신거 같아요.\n\n제가 열심히 살아서 꼭 효도할게요~\n\n구르트',1,'2022-11-17 14:11:02',10,13,'pink'),(23,'얌마 너나 씻어 나 아니라고!!!!!\n브라자 좋은말할때 적당히해',1,'2022-11-17 14:13:01',11,10,'pink'),(24,'마이 도우챠,\n\n꿈을 향해 늘 전심으로 호카스 하는 너의 모습\n\n늘 화이또다.\n\n힘들겠지만 끝까지 노력해서 드리무 카무 츠루다!!',1,'2022-11-13 14:13:14',12,11,'pink'),(25,'사랑하는 딸~♥️\n\n요즘 힘든일은 없지~~?\n\n엄마가 집안일 하느라 신경 많이 못써줘서 미안해~\n\n그래도 우리 딸은 언제나 잘 할거라 엄마는 믿어요.\n\n나중에 아빠 보너스 타면 엄마랑 같이 쇼핑하러가자~~\n\n사랑한다~~',1,'2022-11-17 14:15:28',13,11,'pink');
